    false,nt"url": null,nt"notes": "This data set contains vector lines and
    polygons representing the shoreline and coastal habitats for Alabama, classified
    according to the Environmental Sensitivity Index (ESI) classification system. This
    data set comprises a portion of the ESI data for Alabama. ESI data characterize
    the marine and coastal environments and wildlife by their sensitivity to spilled
    oil. The ESI data include information for three main components: shoreline habitats,
    sensitive biological resources, and human-use resources.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
